# Zubin
Zubin = ""

charset = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/"

# Zubin
data = [] # Zubin
for i in range(len(Zubin)):
    char = Zubin[i:i+1]
    location = charset.find(char)
    data.insert(i, location * 4) # Zubin

ZubinImage = Image.frombytes("L", (128, 128), bytes(data)) # Zubin
ZubinImage.show() # Zubin

